INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 1, 450, 119901, 2.17, 14, "2025/12/21 12:00:00", 3, 119901, 1, 0, 0, 1, "ミヤコ（クリスマス）", 0, "みやこ", 0, "2025/12/31 11:59:59", "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 302, 119901, 1, 0, 0, 119901);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 5, 450, 120001, 2.375, 6, "2025/03/10 12:00:00", 3, 120001, 1, 0, 0, 5, "シズル（ノワール）", 0, "しずる", 0, "2025/03/15 14:59:59", "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 190, 120001, 1, 0, 0, 120001);
