INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 8, 450, 137101, 2.09, 0, "2025/08/15 15:00:00", 3, 137101, 2, 0, 0, 47, "ニノン（サマー）", 0, "にのん", 0, "2030/12/31 15:00:00", "【魔法】中衛で陽光の下、煌く水面を共に駆けるシノビ。\n【水遁の印】を自らの攻撃力へと変え、束縛フィールドと\n水遁の術で最も遠い敵とその周囲に速やかな天誅を下す。", 566, 137101, 0, 0, 0, 137101);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 2, 0, 0, 0.0, 0, "2015/04/01 15:00:00", 3, 137201, 0, 0, 0, 2, "ラビリスタ", 0, "らびりすた", 0, "2030/12/31 15:00:00", "", 0, 137201, 0, 0, 0, 0);
