INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 7, 450, 137401, 2.09, 0, "2025/11/03 12:00:00", 3, 137401, 2, 0, 0, 21, "カスミ（シスター）", 0, "かすみ", 0, "2025/11/14 14:59:59", "【魔法】後衛で、聖なる光に包まれ微笑み祈るシスター。\n攻防デバフを操り【真実の導き】が集まると最大３キャラ\nへの攻撃が最も魔防の低い敵を追及し、真理を照らす。", 688, 137401, 1, 0, 0, 137401);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 1, 0, 0, 0.0, 0, "2015/04/01 15:00:00", 3, 137501, 0, 0, 0, 1, "アイラ", 0, "あいら", 0, "2030/12/31 15:00:00", "", 0, 137501, 1, 0, 0, 0);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 7, 450, 137601, 2.09, 0, "2025/12/31 12:00:00", 3, 137601, 2, 0, 0, 0, "コッコロ（嚮導幼君）", 0, "こっころ", 0, "2026/01/03 11:59:59", "【魔法】後衛で、主さまを想い“進化”した嚮導の巫女。\n極大ダメージのＵＢで敵を穿ち、【進化超越】の権能によ\nって、味方のバフやダメージを、限界を超え成長させる。", 733, 137601, 1, 0, 0, 137601);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 7, 0, 0, 0.0, 0, "2015/04/01 15:00:00", 3, 137801, 0, 0, 0, 1, "ユキノ", 0, "ゆきの", 0, "2030/12/31 15:00:00", "", 0, 137801, 1, 0, 0, 0);
