INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 6, 450, 191301, 2.22, 0, "2015/04/01 15:00:00", 1, 191301, 1, 0, 0, 6, "カズマサ", 0, "かずまさ", 0, "2030/12/31 15:00:00", "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 850, 191301, 1, 0, 0, 191301);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES (0, 6, 0, 0, 0.0, 0, "2015/04/01 15:00:00", 0, 191401, 0, 0, 0, 6, "コッコロ", 0, "こっころ", 0, "2030/12/31 15:00:00", "", 0, 191401, 0, 0, 0, 0);
